'use strict';
let AManagerAccountWrapperStorage = require('./AManagerAccountWrapperStorage.js');
let OpenPositionsManagerWithAccountFilter = require('./OpenPositionsManagerWithAccountFilter.js');
class OpenPositionsManagerAccountWrapperStorage extends AManagerAccountWrapperStorage {
    openPositionsManager;
    static create(openPositionsManager) {
        let instance;
        instance = new OpenPositionsManagerAccountWrapperStorage();
        instance.openPositionsManager = openPositionsManager;
        return instance;
    }
    createManagerByAccount(accountInfo) {
        return OpenPositionsManagerWithAccountFilter.createManagerWithAccountFilter(this.openPositionsManager, accountInfo);
    }
    get(accountInfo) {
        return this.getObjectByAccount(accountInfo);
    }
}
module.exports = OpenPositionsManagerAccountWrapperStorage
